import React, { useEffect, useState } from 'react';

const App = () => {
  const url = "/users";
  const [users, setUsers] = useState([]);

  useEffect(() => {
    fetch(url, { method: "GET" })
      .then((res) => res.json())
      .then((data) => {
        setUsers(data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div className="App">
      <h1>Users</h1>
        {users[0].name}
    </div>
  );
}

export default App;
